import React from 'react';
import {Box} from '@mui/material';
import './ProgressBar.scss';
import { Pause } from '@mui/icons-material';

const ProgressBar = () => {

    return(
        <Box id="progress-bar">
            <Box className="inner">
                <Pause className="icon"/>
            </Box>

        </Box>

    )

};

export default ProgressBar;
